import dynamic from 'next/dynamic'
import Title from '../components/home/Title';
import { LandingScene } from '../components/scenes/Landing';
import { getSketches } from '../lib/sketches';

const Gallery = dynamic(() => import('../components/home/Gallery'))

export async function getStaticProps() {
	const sketches = getSketches()

	return {
		props: { sketches },
	}
}

const HomePage = ({ sketches }) => {
	console.log(sketches);
	return (
		<div id="outer-container" className="h-full w-full text-gray-200 relative md:px-16">
			<section className="h-screen relative flex mx-auto">
				<Title />
				<LandingScene />
			</section>
			{/* <section className="inner-container h-screen container mx-auto">
				<Main />
			</section> */}
			<Gallery className="inner-container h-screen container mx-auto" sketches={sketches} />
		</div>
	);
};

export default HomePage;
